import React from "react";
import "./search.css"



const SearchBox = ({ onk, onc, location }) => {
    return (
        <div id="searchBox">
            <input type="search" placeholder="ادخل المدينة" id="search" value={location}  onChange={event => onc()} onKeyPress={(event) => onk({event: event})} />
        </div>
    );
};

export default SearchBox;
